info:
  contact: {email: frikky@shuffler.io, name: '@frikkylikeme', url: 'https://twitter.com/frikkylikeme'}
  description: Automated generation of DomainTools DomainTools
  title: DomainTools DomainTools
  version: 1.0.0
  x-logo: data:image/png;base64,
openapi: 3.0.2
paths:
  tmp0:
    post:
      description: Get Brand Monitor from DomainTools
      parameters:
      - description: Domain to run Brand Monitor on
        example: google.com
        in: query
        name: Domain
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: DomainTools Brand Monitor
  tmp1:
    post:
      description: Get Domain Profile from DomainTools
      parameters:
      - description: Domain to run Domain Profile on
        example: google.com
        in: query
        name: Domain
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: DomainTools Domain Profile
  tmp2:
    post:
      description: Get Hosting History from DomainTools
      parameters:
      - description: Domain to run hosting history on
        example: google.com
        in: query
        name: Domain
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp2'}
          description: Successful request
      summary: DomainTools Hosting History
  tmp3:
    post:
      description: Get Reputation from DomainTools
      parameters:
      - description: Domain to run reputation lookup pn
        example: example.com
        in: query
        name: Domain
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp3'}
          description: Successful request
      summary: DomainTools Reputation
  tmp4:
    post:
      description: Get Reverse IP from DomainTools
      parameters:
      - description: Domain to run Reverse IP on
        example: google.com
        in: query
        name: Domain
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp4'}
          description: Successful request
      summary: DomainTools Reverse IP
  tmp5:
    post:
      description: Get Reverse Whois from DomainTools
      parameters:
      - description: Query to run Reverse WhoIs on, separated with commas
        example: apple,google,amazon
        in: query
        name: Query
        required: true
        schema: {type: string}
      - description: True for Purchase Mode, False for Quote mode
        example: ''
        in: query
        name: Purchase Mode
        required: false
        schema: {type: boolean}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp5'}
          description: Successful request
      summary: DomainTools Reverse Whois
  tmp6:
    post:
      description: Get WhoIs from DomainTools
      parameters:
      - description: IP to run WhoIs on
        example: 192.168.1.1
        in: query
        name: IP
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp6'}
          description: Successful request
      summary: DomainTools WhoIs
  tmp7:
    post:
      description: Get WhoIs History from DomainTools
      parameters:
      - description: Domain to run whois history on
        example: google.com
        in: query
        name: Domain
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp7'}
          description: Successful request
      summary: DomainTools WhoIs History
